import React, {useState} from "react";

function UseState() {
  const [counter, setCounter] = useState(0);
  const increment = () => {
    setCounter((prevState) => {
      return prevState++;
    });
  }
  return (
    <div className="mx-auto">
      <h2>Counter: {counter}</h2>
      <button className="btn" onClick={increment}>
        Increment
      </button>
    </div>
  );
}

export default UseState;
